post_text:
Congratulations to the GHS Math Team for their outstanding success at Sunnyside!

Team Problem: 1st place Cameron Mains and Austin Williams;
2nd place Jenna Bradwell and Sara Hiebert; 3rd place Sandra Crook and Natasha Muzechenko

Topical Team: 1st place Cameron Mains and Austin Williams;
2nd place Sandra Crook and Natasha Muzechenko; 3rd place Nick Lee and Matt Coleman.

Knowdown (which is all students from all region competed as individuals): 3rd Place Matt Coleman

